  true,\n\t\"url\": null,\n\t\"notes\": \"Special Database 19 contains NIST's entire
  corpus of training materials for handprinted document and character recognition.
  It publishes Handprinted Sample Forms from 3600 writers, 810,000 character images
  isolated from their forms, ground truth classifications for those images, reference
  forms for further data collection, and software utilities for image management and
  handling. there are two editions of the databases.  One is the original database
  with the images in mis or pct format.  It also includes software to open and manipulate
